  if (coverSwitch === 0) {
    return (
      <form>
        <button type="submit">Add New Expense</button>
      </form>
    );
  }

  return (
    <form>
      <button type="submit">Add New Expense</button>
    </form>
  );
};

export default ExpenseCover;
